        // Add export logic
    };

    return (
        <div>
            <button id="exportBtn" className="download-button" onClick={handleExportClick}>
                <span className="icon-download"></span> {/* span for icon */}
                Export Data/Visualizations
            </button>
        </div>
    );
}

